//**Created by Anand Sharma**//

def roleToCreate = context.expand( '${DataSource#RoleToCreate}' )
def response = context.expand( '${Get User Roles#Response#$.ResponseData}' )


def roleList = new groovy.json.JsonSlurper().parseText(response)
//log.info(roleList.size)

for (int i=0; i<=roleList.size ; i++)
{
	def role = context.expand( '${Get User Roles#Response#$.ResponseData['+i+'].roleName}' )

	if (role == roleToCreate)
	{
		def roleDetail = context.expand( '${Get User Roles#Response#$.ResponseData['+i+']}' )
		return roleDetail.toString()
	}
}

//**Created by Anand Sharma**//

