con:configuration.script:
def expected = context.expand( '${DataSource#expected}' )
def actual = context.expand( '${statusGen#actual}' )

def status = "Failed"
if  (expected==actual)
{
	status = "Passed"
	return status.toString()
}

return status.toString()

def CreateProvider = context.expand( '${Create Provider#Response#$.ResponseStatus}' )
def ResetPassword = context.expand( '${Provider - Reset Password#Response#$.ResponseStatus}' )
def GetProviderList = context.expand( '${Get Provider List#Response#$.ResponseStatus}' )
def GetorgList = context.expand( '${Get org List#Response#$.ResponseStatus}' )
def GetUserRoles = context.expand( '${Get User Roles#Response#$.ResponseStatus}' )
def ProviderActivate = context.expand( '${Provider - Activate#Response#$.ResponseStatus}' )
def ProviderApproval = context.expand( '${Provider - Approval#Response#$.ResponseStatus}' )
def ImageUpload = context.expand( '${Image Upload#Response#$.ResponseStatus}' )


if ((CreateProvider=="OK") && (ResetPassword=="OK") && (GetProviderList=="OK") && (GetorgList=="OK") && (GetUserRoles=="OK") && (ProviderActivate=="OK") && (ProviderApproval=="OK") && (ImageUpload=="OK"))
{
	def res = "Passed"
	return res.toString()
}

else
{
	def res="Failed"
	return res.toString()
}
